import React from 'react';
import '../App.css';

function Dashboards() {
  return (
    <div className='container col-12'>
      <div className='panel-content mt-2'>
        <h1 className='page-title'>Dashboards</h1>
      </div>
    </div>
  );
}

export default Dashboards;
